func fmtMonth(locale, context, width string) func(int, string) string {
	key := monthKey{locale: locale, calendarType: "gregorian", width: width, context: context}
	i, ok := monthLookup[key]
	if !ok && context == "stand-alone" {
		key.context = "format"
		i = monthLookup[key]
	}

	names := calendarMonthNames[i]

	return func(m int, _ string) string {
		return names[m-1]
	}
}

